import React, { useState } from 'react'

import { Formik, Form, FieldArray } from 'formik'

import PropTypes from 'prop-types'
import { Box, Tabs, Tab, Typography, FormControl, FormLabel, Select, MenuItem } from '@mui/material'

import maximumStayDurationy from '../../Json/maximumStayDurationy'

import 'bootstrap/dist/css/bootstrap.css'
import Carousel from 'react-bootstrap/Carousel'

function TabPanel(props) {

    const { children, value, index, ...other } = props

    return (
        <div
            role='tabpanel'
            hidden={value !== index}
            id={`simple-tabpanel-${index}`}
            aria-labelledby={`simple-tab-${index}`}
            {...other}
        >
            {value === index && (
                <Box sx={{ p: 3 }}>
                    <Typography>{children}</Typography>
                </Box>
            )}
        </div>
    )
}

TabPanel.propTypes = {
    children: PropTypes.node,
    index: PropTypes.number.isRequired,
    value: PropTypes.number.isRequired,
}

function a11yProps(index) {
    return {
        id: `simple-tab-${index}`,
        'aria-controls': `simple-tabpanel-${index}`,
    }
}

const LivingPlaceInformations = (props) => {

    let initialValues = {
        rooms: ''
    }

    initialValues.rooms = props.data.rooms
    console.log('initialValues', initialValues)

    const [value, setValue] = useState(0)

    const handleChangeTab = (event, newValue) => {
        setValue(newValue, true)
    }

    console.log('number_of_rooms_with_living_places', props.data.residence.number_rooms_with_vhes)
    const numberOfRooms = parseInt(props.data.residence.number_rooms_with_vhes)
    let numberOfLivingPlaces = []
    for(let i = 0; i < numberOfRooms; i++) {
        numberOfLivingPlaces.push(parseInt(props.data.rooms[i].number_of_living_places))
        console.log(numberOfLivingPlaces)
    }

    for(let i = 0; i <numberOfRooms; i++) {

    }

    return (
        <>
            <Formik
                initialValues={initialValues}
                onSubmit={(data) => {
                    props.next(data)
                }}
            >
                {({ values, handleChange }) => (
                    <Form>
                        <FieldArray name='rooms'>
                            {({ remove, push }) => (
                                <div>
                                    <Box sx={{ width: '100%' }}>
                                        <Box sx={{ borderBottom: 1, borderColor: 'divider' }}>
                                            <Tabs value={value} onChange={handleChangeTab} aria-label='basic tabs example' centered>
                                                {Array.from(Array(numberOfRooms), (e, index) => {
                                                    return (
                                                        <Tab label='Item One' {...a11yProps(index)} />
                                                    )
                                                })}
                                            </Tabs>
                                        </Box>
                                        {props.data.residence.number_rooms_with_vhes > 0 && values.rooms.map((room, index) => (
                                            <TabPanel value={value} index={index}>
                                                <Carousel style={{ backgroundColor: 'red' }} interval={20} wrap={false}>
                                                    {Array.from(Array(numberOfLivingPlaces[index]), (e, indexVhe) => {
                                                        return (
                                                            <Carousel.Item>
                                                                <div>

                                                                    {/* MAXIMUM STAY DURATION */}
                                                                    <FormControl>
                                                                        <FormLabel component='legend' style={{ color: 'black', marginBottom: '10px'}}>Maximum stay duration</FormLabel>
                                                                        <Select
                                                                            name={`rooms.${index}.vhe_list.${indexVhe}.max_stay_duration`}
                                                                            value={formik.values.complex.phone_number_landcode}
                                                                            onChange={formik.handleChange}
                                                                            /* error={formik.touched.introduction.vhe_type && Boolean(formik.errors.introduction.vhe_type)}
                                                                            helperText={formik.touched.vhe_type && formik.errors.vhe_type} */
                                                                        >
                                                                            <MenuItem value=''>Choose a country</MenuItem>
                                                                            {maximumStayDurationy.map((item, index) => (
                                                                                <MenuItem key={index} value={item.value}>{item.label}</MenuItem>
                                                                            ))}
                                                                        </Select>
                                                                    </FormControl>
                                                                </div>
                                                            </Carousel.Item>
                                                        )
                                                    })}
                                                </Carousel>
                                            </TabPanel>
                                        ))}
                                    </Box>
                                </div>
                            )}
                        </FieldArray>
                        <button type='submit'>Submit</button>
                    </Form>
                )}
            </Formik>
        </>
    )
}

export default LivingPlaceInformations
